import { useEffect, useState } from "react";
import AOS from "aos";
import { Trainers, Staff, members } from "./Data"

const StaffOTrainers = (element) => {


    const [staff, setStaff] = useState([])


    useEffect(() => {
        AOS.init(
        );

        if (element.type == "trainer") {
            setStaff(Trainers)
        } else if (element.type == "staff") {
            setStaff(Staff)
        } else {
            setStaff(members)
        }

    }, []);





    return (
        <div className="trainers" data-aos="fade-up">
            {
                staff.map((employer) => (

                    <div className="circle" key={employer.id}>
                        <img className={element.ppClass} src={employer.photo} />
                        <div className={element.nameClass}>{employer.firstName}</div>
                        {element.specialization &&
                            <div class={element.specialization}>{employer.specialization}</div>
                        }
                    </div>

                )
                )
            }
        </div>
    )


}

export default StaffOTrainers
